="eds-g-cell eds-g-cell-1-1 eds-g-cell-mn-1-2 eds-l-pad-hor-4 eds-l-mw-pad-hor-14 eds-l-ln-pad-hor-14 eds-l-lg-pad-hor-14 eds-l-lw-pad-hor-14 eds-l-mar-bot-4" data-reactid="605"><dt class="marketing-default-text eds-text-weight--heavy eds-text-bm eds-text-color--grey-900 eds-l-pad-top-2" data-reactid="606"><!-- react-text: 607 -->Can I change my package?<!-- /react-text --></dt><dd class="marketing-default-text eds-l-pad-top-1" data-reactid="608">Yes! You can change your package at any time. Upgrades will apply immediately to all your live and drafted events, so you can take advantage of Professional product capabilities.  Downgrades will apply only to events created after you make the change.</dd><dd class="marketing-default-text" data-reactid="609"></dd></dl><dl class="eds-g-cell eds-g-cell-1-1 eds-g-cell-mn-1-2 eds-l-pad-hor-4 eds-l-mw-pad-hor-14 eds-l-ln-pad-hor-14 eds-l-lg-pad-hor-14 eds-l-lw-pad-hor-14 eds-l-mar-bot-4" data-reactid="610"><dt class="marketing-default-text eds-text-weight--heavy eds-text-bm eds-text-color--grey-900 eds-l-pad-top-2" data-reactid="611"><!-- react-text: 612 -->What is a &quot;ticket type&quot;?<!-- /react-text --></dt><dd class="marketing-default-text eds-l-pad-top-1" data-reactid="613">A ticket type is a unique combination of name, price, and availability that you create to create demand or appeal to different audiences. For example, an event with "General Admission - Early Bird", "General Admission - Regular", and "VIP" has 3 ticket types.</dd><dd class="marketing-default-text" data-reactid="614"></dd></dl><dl class="eds-g-cell eds-g-cell-1-1 eds-g-cell-mn-1-2 eds-l-pad-hor-4 eds-l-mw-pad-hor-14 eds-l-ln-pad-hor-14 eds-l-lg-pad-hor-14 eds-l-lw-pad-hor-14 eds-l-mar-bot-4" data-reactid="615"><dt class="marketing-default-text eds-text-weight--heavy eds-text-bm eds-text-color--grey-900 eds-l-pad-top-2" data-reactid="616"><!-- react-text: 617 -->Does Eventbrite have a free option?<!-- /react-text --></dt><dd class="marketing-default-text eds-l-pad-top-1" data-reactid="618">Yes! Both our Essentials and Professional products are free for free tickets — we only charge you each time you sell a paid ticket. Organizers with only free events have access to everything in Essentials, and everything in Professional except for phone, chat, or email support.</dd><dd class="marketing-default-text" data-reactid="619"></dd></dl><dl class="eds-g-cell eds-g-cell-1-1 eds-g-cell-mn-1-2 eds-l-pad-hor-4 eds-l-mw-pad-hor-14 eds-l-ln-pad-hor-14 eds-l-lg-pad-hor-14 eds-l-lw-pad-hor-14 eds-l-mar-bot-4" data-reactid="620"><dt class="marketing-default-text eds-text-weight--heavy eds-text-bm eds-text-color--grey-900 eds-l-pad-top-2" data-reactid="621"><!-- react-text: 622 -->What are ticketing and registration &quot;essentials&quot;?<!-- /react-text --></dt><dd class="marketing-default-text eds-l-pad-top-1" data-reactid="623">Ticketing and registration essentials include the things you need to succesfully execute a simple event, including a mobile-optimized event page, general admission ticketing, a summary reporting dashboard, exportable attendee data, and on-site check-in.</dd><dd class="marketing-default-text" data-reactid="624"><a href="https://www.eventbrite.com/organizer/compare-packages">You can see a full list of features here.</a></dd></dl><dl class="eds-g-cell eds-g-cell-1-1 eds-g-cell-mn-1-2 eds-l-pad-hor-4 eds-l-mw-pad-hor-14 eds-l-ln-pad-hor-14 eds-l-lg-pad-hor-14 eds-l-lw-pad-hor-14 eds-l-mar-bot-4" data-reactid="625"><dt class="marketing-default-text eds-text-weight--heavy eds-text-bm eds-text-color--grey-900 eds-l-pad-top-2" data-reactid="626"><!-- react-text: 627 -->Do packages and prices differ by location or currency?<!-- /react-text --></dt><dd class="marketing-default-text eds-l-pad-top-1" data-reactid="628">Eventbrite's pricing is based on your package. Packages differ slightly based on feature availability for each region, and price tiers determined by the event's currency. Based on your current location, Essentials pricing is 2% + $0.79 per paid ticket and Professional pricing is 3.5% + $1.59 per paid ticket. Both packages are always free for free tickets.</dd><dd class="marketing-default-text" data-reactid="629"><a href="https://www.eventbrite.com/support/articleredirect?anum=7285">Click here to see packages and pricing for every supported currency.</a></dd></dl><dl class="eds-g-cell eds-g-cell-1-1 eds-g-cell-mn-1-2 eds-l-pad-hor-4 eds-l-mw-pad-hor-14 eds-l-ln-pad-hor-14 eds-l-lg-pad-hor-14 eds-l-lw-pad-hor-14 eds-l-mar-bot-4" data-reactid="630"><dt class="marketing-default-text eds-text-weight--heavy eds-text-bm eds-text-color--grey-900 eds-l-pad-top-2" data-reactid="631"><!-- react-text: 632 -->What if I don&#x27;t want to list my event on Eventbrite and partner sites?<!-- /react-text --></dt><dd class="marketing-default-text eds-l-pad-top-1" data-reactid="633">Each time you create a ticketing or registration page, you'll have the opportunity to mark your event as "Public" or "Private." If you mark it "Private", it won't be listed on Eventbrite or any of our partner sites. If you mark it "Public", it'll be listed on both to help you reach new audiences.</dd><dd class="marketing-default-text" data-reactid="634"></dd></dl><dl class="eds-g-cell eds-g-cell-1-1 eds-g-cell-mn-1-2 eds-l-pad-hor-4 eds-l-mw-pad-hor-14 eds-l-ln-pad-hor-14 eds-l-lg-pad-hor-14 eds-l-lw-pad-hor-14 eds-l-mar-bot-4" data-reactid="635"><dt class="marketing-default-text eds-text-weight--heavy eds-text-bm eds-text-color--grey-900 eds-l-pad-top-2" data-reactid="636"><!-- react-text: 637 -->How do I pay my fees?<!-- /react-text --></dt><dd class="marketing-default-text eds-l-pad-top-1" data-reactid="638">When using Eventbrite's payment processing, you have the option to either "absorb" your fees and pay them out of your ticketing revenue, or pass them along to your ticket buyers. The majority of organizers who pass fees to their buyers pay nothing out of pocket to use Eventbrite! If you choose to use a third party payment processor, you'll be invoiced for your fees.</dd><dd class="marketing-default-text" data-reactid="639"></dd></dl><dl class="eds-g-cell eds-g-cell-1-1 eds-g-cell-mn-1-2 eds-l-pad-hor-4 eds-l-mw-pad-hor-14 eds-l-ln-pad-hor-14 eds-l-lg-pad-hor-14 eds-l-lw-pad-hor-14 eds-l-mar-bot-4" data-reactid="640"><dt class="marketing-default-text eds-text-weight--heavy eds-text-bm eds-text-color--grey-900 eds-l-pad-top-2" data-reactid="641"><!-- react-text: 642 -->What are my payment processing options?<!-- /react-text --></dt><dd class="marketing-default-text eds-l-pad-top-1" data-reactid="643">The vast majority of Eventbrite organizers use Eventbrite Payment Processing, our native payment processor that enables full access to all features in your selected package and has historically increased sales conversion by up to 20%. If you already have a PayPal or Auth.net payment processing account, you're welcome to use either of those providers as well.</dd><dd class="marketing-default-text" data-reactid="644"></dd></dl></div></div></section></div></div></main><footer class="eds-global-footer eds-g-grid l-mar-top-2" data-reactid="645"><h2 class="eds-is-hidden-accessible" data-reactid="646">Site Navigation</h2><div class="eds-bg-color--grey-900 eds-hide-sw eds-hide-sm eds-hide-sn" data-reactid="647"><div class="eds-g-cell eds-g-cell-3-12 eds-l-pad-left-6 eds-l-pad-top-4" data-reactid="648"><h3 class="eds-l-pad-vert-2" data-reactid="649">Use Eventbrite</h3><ul class="eds-l-pad-vert-2 eds-l-mar-all-0 eds-l-pad-hor-0" data-reactid="650"><li data-reactid="651"><a href="https://www.eventbrite.com/organizer/overview/" class="eds-global-footer__link" data-reactid="652">How It Works</a></li><li data-reactid="653"><a href="https://www.eventbrite.com/organizer/overview/?ref=ebfooter" class="eds-global-footer__link" data-reactid="654">For Large &amp; Complex Events</a></li><li data-reactid="655"><a href="index.html" class="eds-global-footer__link" data-reactid="656">